import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const Header = () => {
  const [activeButton, setActiveButton] = useState('Dashboard');
  const [isHovered, setIsHovered] = useState(false);

  const navItems = [
    { name: 'Dashboard', icon: 'ðŸ“Š' },
    { name: 'Analytics', icon: 'ðŸ“ˆ' },
    { name: 'Reports', icon: 'ðŸ“‘' }
  ];

  return (
    <motion.header 
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      className="relative bg-gradient-to-r from-purple-700 via-blue-600 to-cyan-500 text-white overflow-hidden"
    >
      {/* Interactive background elements */}
      <motion.div 
        className="absolute inset-0 overflow-hidden"
        animate={{
          background: isHovered 
            ? "radial-gradient(circle at var(--x) var(--y), rgba(255,255,255,0.15) 0%, rgba(255,255,255,0) 50%)"
            : "none"
        }}
        onMouseMove={(e) => {
          const rect = e.currentTarget.getBoundingClientRect();
          e.currentTarget.style.setProperty('--x', `${e.clientX - rect.left}px`);
          e.currentTarget.style.setProperty('--y', `${e.clientY - rect.top}px`);
        }}
      >
        <motion.div 
          className="absolute -top-8 -left-8 w-32 h-32 bg-white/10 rounded-full blur-2xl"
          animate={{ scale: isHovered ? 1.2 : 1 }}
          transition={{ type: "spring", stiffness: 300 }}
        />
        <motion.div 
          className="absolute top-0 right-0 w-48 h-48 bg-white/5 rounded-full blur-3xl"
          animate={{ scale: isHovered ? 1.1 : 1 }}
          transition={{ type: "spring", stiffness: 200 }}
        />
      </motion.div>

      <div 
        className="relative max-w-7xl mx-auto px-4 py-8"
        onMouseEnter={() => setIsHovered(true)}
        onMouseLeave={() => setIsHovered(false)}
      >
        <div className="flex flex-col md:flex-row justify-between items-center space-y-4 md:space-y-0">
          <motion.div
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ delay: 0.2 }}
          >
            <motion.h1 
              className="text-4xl font-extrabold tracking-tight cursor-pointer"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <motion.span
                className="inline-block"
                whileHover={{ y: -5 }}
                transition={{ type: "spring", stiffness: 500 }}
              >
                AI Product Trend
              </motion.span>
              <motion.span 
                className="block text-cyan-300"
                animate={{ y: [0, -5, 0] }}
                transition={{ duration: 2, repeat: Infinity }}
              >
                Predictor
              </motion.span>
            </motion.h1>
          </motion.div>

          <div className="flex items-center space-x-6">
            <motion.div
              initial={{ opacity: 0, scale: 0.5 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ delay: 0.4 }}
              className="flex items-center space-x-2"
              whileHover={{ scale: 1.05 }}
            >
              <motion.div 
                className="h-3 w-3 bg-green-400 rounded-full"
                animate={{ 
                  scale: [1, 1.2, 1],
                  backgroundColor: ['#4ade80', '#60a5fa', '#4ade80']
                }}
                transition={{ duration: 2, repeat: Infinity }}
              />
              <motion.span 
                className="px-4 py-2 rounded-full bg-white/10 backdrop-blur-sm border border-white/20 cursor-pointer"
                whileHover={{ backgroundColor: 'rgba(255,255,255,0.2)' }}
                whileTap={{ scale: 0.95 }}
              >
                Real-time Analysis
              </motion.span>
            </motion.div>

            <motion.nav
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.6 }}
              className="hidden md:flex space-x-4"
            >
              <AnimatePresence mode="wait">
                {navItems.map((item) => (
                  <motion.button
                    key={item.name}
                    onClick={() => setActiveButton(item.name)}
                    className={`px-4 py-2 rounded-lg text-sm transition-colors relative ${
                      activeButton === item.name ? 'text-white' : 'text-white/70'
                    }`}
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                  >
                    <span className="flex items-center gap-2">
                      {item.icon}
                      {item.name}
                    </span>
                    {activeButton === item.name && (
                      <motion.div
                        className="absolute inset-0 bg-white/10 rounded-lg -z-10"
                        layoutId="activeTab"
                        transition={{ type: "spring", bounce: 0.2 }}
                      />
                    )}
                  </motion.button>
                ))}
              </AnimatePresence>
            </motion.nav>
          </div>
        </div>
      </div>

      <motion.div 
        className="h-1 bg-gradient-to-r from-cyan-500 via-blue-500 to-purple-600"
        whileHover={{ height: '2px' }}
      />
    </motion.header>
  );
};

export default Header;
